import { Navbar } from "react-bootstrap";

const NavbarComp = () => (
  <>
    <Navbar bg="dark">
      <Navbar.Brand href="#home">
        <img src="/home.png" alt="React Bootstrap logo" />
      </Navbar.Brand>
    </Navbar>
  </>
);

export default NavbarComp;
